import React from 'react';

const VideoCard = ({ info }) => {
  const { snippet, statistics } = info;
  const { channelTitle, title, thumbnails } = snippet;

  return (
    <div className="p-2 m-1 w-full sm:w-1/2 md:w-1/3 lg:w-1/4 xl:w-1/5">
      <div className="bg-white border border-gray-300 rounded-lg shadow-lg overflow-hidden">
        <img className="w-full h-40 object-cover" alt="Thumbnail" src={thumbnails.high.url} />
        <div className="p-3">
          <h2 className="text-sm md:text-base font-semibold">{title}</h2>
          <p className="text-xs text-gray-600">{channelTitle}</p>
          <p className="text-xs text-gray-500">{statistics.viewCount} views</p>
        </div>
      </div>
    </div>
  );
};

export default VideoCard;
